import { useSelector, useDispatch } from "react-redux";
import { useState } from "react";
import {orderPokemon} from "../../redux/actions"
import style from "./Filter.module.css"

const Filter = () => {

    const allPokemons = useSelector((state) => state.allPokemons);
    const dispatch = useDispatch();
    const [aux, setAux] = useState(false);

    const handlerOrderPokemonName = (event) => {
        dispatch(orderPokemon(event.target.value));
        setAux(true);
    };

    // const handlerFilter = (event) => {
    //     dispatch(filterCards(event.target.value));
    // };

    return (
        <div>
            <div className={style.Selector}>
                <select name="OrderPokemonName" onChange={handlerOrderPokemonName} className={style.SelectorOrder}>
                    <option key={0} value="" disabled selected> Order by </option>
                    <optgroup label="Alphabet" />  
                    <option key={2} value="asc">Asc</option>
                    <option key={3} value="des">Des</option>
                </select>
            </div>
        </div>
    )
}

export default Filter;
